import { useState } from "react";

const noShowOptions = [">10%", "10-20%", "20-50%", "<50%"];
const unqualifiedOptions = [">10%", "10-20%", "20-50%", "<50%"];

const mapDropdown = (value, mapping) => {
  return mapping[value.trim()] || 0.0;
};

const calculateROI = (hourlyRate, weeklyConsults, noShowPct, unqualifiedPct, intakeMinutes) => {
  const noShowRate = mapDropdown(noShowPct, {
    ">10%": 0.15,
    "10-20%": 0.20,
    "20-50%": 0.35,
    "<50%": 0.50,
  });

  const unqualifiedRate = mapDropdown(unqualifiedPct, {
    ">10%": 0.15,
    "10-20%": 0.20,
    "20-50%": 0.35,
    "<50%": 0.50,
  });

  const consultLoss = (noShowRate + unqualifiedRate) * weeklyConsults * hourlyRate;
  const adminLoss = (intakeMinutes * weeklyConsults / 60) * hourlyRate;
  const totalLoss = consultLoss + adminLoss;
  const roiRecovered = totalLoss * 0.75;

  return {
    consultLoss: consultLoss.toFixed(2),
    adminLoss: adminLoss.toFixed(2),
    totalLoss: totalLoss.toFixed(2),
    roiRecovered: roiRecovered.toFixed(2)
  };
};

export default function ClauslyCalculator() {
  const [form, setForm] = useState({
    hourlyRate: "300",
    weeklyConsults: "10",
    noShowPct: ">10%",
    unqualifiedPct: ">10%",
    intakeMinutes: "30",
  });
  const [result, setResult] = useState(null);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const roi = calculateROI(
      parseFloat(form.hourlyRate),
      parseInt(form.weeklyConsults),
      form.noShowPct,
      form.unqualifiedPct,
      parseInt(form.intakeMinutes)
    );
    setResult(roi);
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-zinc-900 text-white rounded-xl shadow-md">
      <h2 className="text-xl font-semibold mb-4">Clausly ROI Calculator</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block mb-1 text-sm text-zinc-300">Hourly Rate ($)</label>
          <input name="hourlyRate" value={form.hourlyRate} onChange={handleChange} className="w-full p-2 rounded bg-zinc-800" />
        </div>

        <div>
          <label className="block mb-1 text-sm text-zinc-300"># of Weekly Consults</label>
          <input name="weeklyConsults" value={form.weeklyConsults} onChange={handleChange} className="w-full p-2 rounded bg-zinc-800" />
        </div>

        <div>
          <label className="block mb-1 text-sm text-zinc-300">No-Show Rate</label>
          <select name="noShowPct" value={form.noShowPct} onChange={handleChange} className="w-full p-2 rounded bg-zinc-800">
            {noShowOptions.map(opt => <option key={opt}>{opt}</option>)}
          </select>
        </div>

        <div>
          <label className="block mb-1 text-sm text-zinc-300">Unqualified Lead Rate</label>
          <select name="unqualifiedPct" value={form.unqualifiedPct} onChange={handleChange} className="w-full p-2 rounded bg-zinc-800">
            {unqualifiedOptions.map(opt => <option key={opt}>{opt}</option>)}
          </select>
        </div>

        <div>
          <label className="block mb-1 text-sm text-zinc-300">Avg Intake Minutes per Lead</label>
          <input name="intakeMinutes" value={form.intakeMinutes} onChange={handleChange} className="w-full p-2 rounded bg-zinc-800" />
        </div>

        <button type="submit" className="w-full p-2 bg-green-600 rounded hover:bg-green-500">Calculate ROI</button>
      </form>

      {result && (
        <div className="mt-6 space-y-2 border-t border-zinc-700 pt-4">
          <div>→ <strong>Consult Loss</strong>: ${result.consultLoss}/week</div>
          <div>→ <strong>Admin Loss</strong>: ${result.adminLoss}/week</div>
          <div>→ <strong>Total Intake Waste</strong>: ${result.totalLoss}/week</div>
          <div className="text-green-400">→ <strong>Clausly ROI Potential</strong>: ${result.roiRecovered}/week</div>
        </div>
      )}
    </div>
  );
}
